public class InnerLaunchTemplateInstanceRequirementsFactory(Action<Humidifier.EC2.LaunchTemplateTypes.InstanceRequirements> factoryAction = null) : SubResourceFactory<Humidifier.EC2.LaunchTemplateTypes.InstanceRequirements>
{

    internal InnerLaunchTemplateNetworkInterfaceCountFactory NetworkInterfaceCountFactory { get; set; }

    internal InnerLaunchTemplateMemoryGiBPerVCpuFactory MemoryGiBPerVCpuFactory { get; set; }

    internal InnerLaunchTemplateVCpuCountFactory VCpuCountFactory { get; set; }

    internal InnerLaunchTemplateAcceleratorCountFactory AcceleratorCountFactory { get; set; }

    internal InnerLaunchTemplateNetworkBandwidthGbpsFactory NetworkBandwidthGbpsFactory { get; set; }

    internal InnerLaunchTemplateBaselineEbsBandwidthMbpsFactory BaselineEbsBandwidthMbpsFactory { get; set; }

    internal InnerLaunchTemplateAcceleratorTotalMemoryMiBFactory AcceleratorTotalMemoryMiBFactory { get; set; }

    internal InnerLaunchTemplateMemoryMiBFactory MemoryMiBFactory { get; set; }

    internal InnerLaunchTemplateTotalLocalStorageGBFactory TotalLocalStorageGBFactory { get; set; }

    protected override Humidifier.EC2.LaunchTemplateTypes.InstanceRequirements Create()
    {
        var instanceRequirementsResult = CreateInstanceRequirements();
        factoryAction?.Invoke(instanceRequirementsResult);

        return instanceRequirementsResult;
    }

    private Humidifier.EC2.LaunchTemplateTypes.InstanceRequirements CreateInstanceRequirements()
    {
        var instanceRequirementsResult = new Humidifier.EC2.LaunchTemplateTypes.InstanceRequirements();

        return instanceRequirementsResult;
    }
    public override void CreateChildren(Humidifier.EC2.LaunchTemplateTypes.InstanceRequirements result)
    {
        base.CreateChildren(result);

        result.NetworkInterfaceCount ??= NetworkInterfaceCountFactory?.Build();
        result.MemoryGiBPerVCpu ??= MemoryGiBPerVCpuFactory?.Build();
        result.VCpuCount ??= VCpuCountFactory?.Build();
        result.AcceleratorCount ??= AcceleratorCountFactory?.Build();
        result.NetworkBandwidthGbps ??= NetworkBandwidthGbpsFactory?.Build();
        result.BaselineEbsBandwidthMbps ??= BaselineEbsBandwidthMbpsFactory?.Build();
        result.AcceleratorTotalMemoryMiB ??= AcceleratorTotalMemoryMiBFactory?.Build();
        result.MemoryMiB ??= MemoryMiBFactory?.Build();
        result.TotalLocalStorageGB ??= TotalLocalStorageGBFactory?.Build();
    }

} // End Of Class

